    return True

def intersection(interval1, interval2):
    start1, end1 = interval1
    start2, end2 = interval2

    if end1 < start2 or end2 < start1:
        return "NO"

    intersection_start = max(start1, start2)
    intersection_end = min(end1, end2)

    intersection_length = intersection_end - intersection_start + 1

    if intersection_start >= start1 and intersection_end <= end1 and intersection_start >= start2 and intersection_end <= end2:
        if is_prime(abs(intersection_length)):
            return "YES"

    if start1 >= start2 and end1 <= end2:
        if is_prime(end1 - start1 + 1):
            return "YES"

    if start2 >= start1 and end2 <= end1:
        if is_prime(end2 - start2 + 1):
            return "YES"

    return "NO"

from itertools import product

def minPath(grid, k):
    n = len(grid)
    m = len(grid[0])
    visited = [[False for _ in range(m)] for _ in range(n)]

    def dfs(i, j, path):
        if i < 0 or i >= n or j < 0 or j >= m or visited[i][j]:
            return
        path.append(grid[i][j])
        visited[i][j] = True
        if len(path) == k:
            return path.copy()
        res = []
        for x, y in product([-1, 0, 1], repeat=2):
            if x == 0 and y == 0:
                continue
            temp = dfs(i+x, j+y, path)
            if temp:
                res.append(temp)
        visited[i][j] = False
        if not res:
            return None
        return min(res)

    for i in range(n):
        for j in range(m):
            path = dfs(i, j, [])
            if path:
                return path

def x_or_y(n, x, y):
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    return x if is_prime(n) else y

def Strongest_Extension(class_name, extensions):
    def strength(extension):
        return sum(1 for c in extension if c.isupper()) - sum(1 for c in extension if c.islower())

    strongest = max(extensions, key=lambda x: strength(x))
    return f"{class_name}.{strongest}"

def int_to_mini_roman(number):
    roman_numerals = {
        1: 'i', 4: 'iv', 5: 'v', 9: 'ix', 10: 'x', 40: 'xl', 50: 'l',
        90: 'xc', 100: 'c', 400: 'cd', 500: 'd', 900: 'cm', 1000: 'm'
    }
    result = ''
    for value, numeral in sorted(roman_numerals.items(), reverse=True):
        while number >= value:
            result += numeral
            number -= value
    return result.lower()

def do_algebra(operator, operand):
    expression = str(operand[0])
    for i in range(len(operator)):
        expression += operator[i] + str(operand[i+1])
    return eval(expression)

import hashlib

def string_to_md5(text):
    if not text:
        return None
    return hashlib.md5(text.encode()).hexdigest()

def even_odd_count(num):
    even_count = len([int(digit) for digit in str(abs(num)) if int(digit) % 2 == 0])
    odd_count = len([int(digit) for digit in str(abs(num)) if int(digit) % 2 != 0])
    return (even_count, odd_count)

